import React from "react";

export default function ItemTabsPhim({ phim }) {
  return (
    <div className="flex">
      <img
        src={phim.hinhAnh}
        alt={phim.tenPhim}
        width={75}
        height={75}
        style={{ objectFit: "cover" }}
      />
      <div>
        <h2>{phim.tenPhim}</h2>
      </div>
    </div>
  );
}
